import React from 'react';
import FakeBookings from './data/fakeBookings.json'
const date1 = new Date(FakeBookings.map((date, index)=>(<p key = "index">{date.checkInDate}</p>)));
const date2 = new Date(FakeBookings.map((date, index)=>(<p key = "index">{date.checkOutDate}</p>)));
const DifferenceInTime = date2.getTime() - date1.getTime();
const DifferenceInDays = DifferenceInTime / (1000 * 3600 * 24);
function DateDiffs() {
  return(
    DifferenceInDays
  )
}
export default DateDiffs
